import React, {useState} from 'react'
import {Button, Grid, Icon,} from '@mui/material'
import TextField from '@mui/material/TextField'
import Dialog from '@mui/material/Dialog'
import DialogActions from '@mui/material/DialogActions'
import DialogContent from '@mui/material/DialogContent'
import LocalizationProvider from '@mui/lab/LocalizationProvider'
import DialogTitle from '@mui/material/DialogTitle'
import {DatePicker} from "@mui/lab";
import AdapterDateFns from "@mui/lab/AdapterDateFns";

export default function FormDialogMetric (metridId){
    const [open, setOpen] = React.useState(false)
    const [state, setState] = useState({
        date: new Date(),
    })

    function handleClickOpen() {
        setOpen(true)
    }

    function handleClose() {
        setOpen(false)
    }

    function handleSend() {
        setOpen(false)

        var url = 'https://example.com/profile';
        var data = {username: 'example'};

        fetch(url, {
            method: 'POST', // or 'PUT'
            body: JSON.stringify(data), // data can be `string` or {object}!
            headers:{
                'Content-Type': 'application/json'
            }
        }).then(res => res.json())
            .catch(error => console.error('Error:', error))
            .then(response => console.log('Success:', response));

        const getData = async () => {

              const resp = await fetch("https://metrics-351617.rj.r.appspot.com/metrics/");
              const data = await resp.json();
              setMetrics(data.content);
              setStatus(true);

        };
    }

    const handleDateChange = (date) => {
        console.log('date' + date)
        setState({...state, date})
    }


    const {
        value,
        date,
    } = state

    return (
        <div>
            <Button
                variant="outlined"
                color="primary"
                onClick={handleClickOpen}
            >
                Add Metric Value
            </Button>
            <Dialog
                open={open}
                onClose={handleClose}
                aria-labelledby="form-dialog-title"
            >
                <DialogTitle id="form-dialog-title">Add Metric Value</DialogTitle>
                <DialogContent>

                        <TextField
                            autoFocus
                            margin="dense"
                            id="value"
                            label="Value"
                            type="text"
                            name="value"
                            fullWidth={true}
                        />
                        <div><br/></div>
                        <LocalizationProvider dateAdapter={AdapterDateFns}>
                            <DatePicker
                                value={date}
                                onChange={handleDateChange}
                                renderInput={(props) => (
                                    <TextField
                                        {...props}
                                        // variant="Outlined"
                                        id="mui-pickers-date"
                                        label="Date"
                                        sx={{mb: 2, width: '100%'}}
                                    />
                                )}
                            />
                        </LocalizationProvider>

                </DialogContent>

                <DialogActions>
                    <Button
                        variant="outlined"
                        color="secondary"
                        onClick={handleClose}
                    >
                        Cancel
                    </Button>
                    <Button onClick={handleSend} color="primary">
                        Send
                    </Button>
                </DialogActions>
            </Dialog>
        </div>
    )
}
